import styles from "./App.module.css";

const App = () => {
  return (
    <div className={styles.outer}>
      <div className={styles.inner}>1</div>
      <div className="inner bg-blue">2</div>
      <div className="inner bg-pink">3</div>
    </div>
  );
};

export default App;
